import { Drawer, Toolbar } from "@mui/material";
import { Box } from "@mui/system";

export const Sidebar = () => {
  return (
    <Drawer
      sx={{
        width: '240px',
        flexShrink: 0,
        "& .MuiDrawer-paper": {
          width: '240px',
          boxSizing: "border-box",
        },
      }}
      variant="permanent"
      anchor="left"
    >
    <Toolbar />

    </Drawer>
  );
};
